Advertising`,subtitle:"Welcome to Nawafith Advertising, where innovative",onCar:"On-Car Advertising",description:"meets impactful brand visibility. Through eye-catching vehicle displays, we drive your brand forwardliterally.",scheduleCall:"SCHEDULE A CALL",explore:"EXPLORE SOLUTIONS",scroll:"Scroll",liveCampaigns:"Live Campaigns",liveSubtitle:"Real-time visibility tracking",marquee:["Dynamic Displays","Real-time Analytics","Geo-Targeting","Audience Measurement","Programmatic DOOH","Smart Bidding"],words:["Smart Data","Real Impact","Deep Insights","Strategic Growth"],nawafithAdvertising:"Nawafith Advertising",badge:"Live Campaigns",cta:"SCHEDULE A CALL"},clients:{title:"Clients Worked With"},mission:{title:"Our",description1:"At",nawafith:"Nawafith Advertising",description2:", we are revolutionizing outdoor advertising with dynamic, innovative",onCar:"on-car solutions",description3:". Our mission is to help businesses connect with their target audiences meaningfully, maximizing visibility and impact on the go.",impactful:"impactful",measurable:"measurable",description4:"We believe outdoor advertising should be both impactful and measurable. Through our cutting-edge digital screens, we provide tools for tracking performance and making informed decisions.",goal:"Our goal is to bring brands closer to people in",realTime:"real-time",description5:"by transforming vehicles into engaging, mobile billboards.",learnMore:"LEARN MORE",missionLabel:"Our Mission",pioneeringTitle:"Pioneering The Future Of",mobilePart:"Advertising Mission",statusLabel:"STATUS",statusValue:"OPTIMIZED",estLabel:"EST.",estValue:"2024",coverageEfficiency:"Coverage Efficiency",activeMonitoring:"Active Monitoring"},solutions:{title:"Nawafith Solution",subtitle:"On-Car Products",digitalTops:"Digital Tops",digitalDesc:"Digital Tops by Nawafith Advertising are equipped with high-quality motion screens and modern data systems, making advertising campaigns more effective and measurable.",dataTracked:"Data-tracked ads",dataDesc:"Real-time tracking and analytics for every campaign, ensuring you know exactly where and when your brand is seen.",scalable:"Scalable advertising offerings",scalableDesc:"From single vehicles to entire fleets, our solutions grow with your brand's ambitions.",label:"Solutions",precisionTitle:"Nawafith",advertisingTitle:"Solutions",synergyDesc:"On-Car Products",explore:"Explore"},cta:{boostTitle:"Ready to Boost Your Brand Visibility?",boostSubtitle:"Schedule a free call today to explore how Nawafith can drive your brand forward.",boostButton:"SCHEDULE A CALL",elevateTitle:"Ready to Elevate Your Advertising?",elevateSubtitle:"Partner with Nawafith today and take your brand to the next level. Lets create impactful, data-driven campaigns that deliver real results. Contact us now to get started!",exploreButton:"EXPLORE SOLUTIONS"},about:{title:"About Us",description1:"At Nawafith, we are proud to be a leading advertising company operating in Saudi Arabia, aligning our services with the ambitious goals of Vision 2030. Our mission is to support businesses in unlocking their potential through innovative, data-driven advertising solutions tailored to the evolving Saudi market.",description2:"Committed to fostering economic growth and creativity, we partner with brands to create impactful campaigns that resonate with local and global audiences. By embracing cutting-edge technology and forward-thinking strategies, we contribute to building a vibrant and diversified economy, supporting the transformation outlined in Vision 2030.",description3:"Join us on this journey of innovation, excellence, and success. Together, we can shape the future of advertising in Saudi Arabia.",missionTitle:"Our Mission",missionDesc1:"At",missionDesc2:"our mission is to redefine the advertising landscape by leveraging the power of mobile, on-car marketing solutions. We aim to help brands amplify their presence in the most dynamic and engaging way, turning everyday vehicles into captivating, high-visibility advertising platforms.",missionDesc3:"Our purpose is to provide businesses with innovative ways to reach audiences on the move, ensuring their message is seen by a diverse range of consumers in real-time, wherever they are. Through creative design, cutting-edge technology, and a deep understanding of the ever-changing market, we strive to create impactful campaigns that drive brand awareness and customer engagement.",whoWeAreLabel:"Who We Are",aboutPart2:"Nawafith Advertising",quote:"Committed to fostering economic growth and creativity, we partner with brands to create impactful campaigns.",establishedLabel:"ESTABLISHED // MMXXIV",purposeLabel:"Our Purpose",missionPart2:"Mission",coverageLabel:"Kingdom Coverage",brandVisibilityLabel:"Brand Visibility"},formats:{title:"Digital Tops Explanation",desc:"Nawafith Advertisings LED screen advertising format combines cutting-edge technology with mobility, offering businesses an exciting way to engage audiences on the move. Our high-definition, weather-resistant LED screens are mounted on vehicles, transforming them into dynamic, real-time advertising platforms that can reach diverse audiences in a variety of settings.",heroSubtitle:"Our Formats",badge1:"High Dynamic Range",badge2:"24/7 Connectivity",cardLabel:"Premium Hardware",cardDesc:"Custom engineered LED systems designed for maximum outdoor visibility and durability.",formatsTitle:"On Car Ad Formats",featTitle:"On Car Ad Formats",featSubtitle:"Versatile. Dynamic. Effective.",live:"Live Update",liveDesc:"Real-time content changes remotely.",static:"Static Image",staticDesc:"High-impact high-resolution visuals.",geo:"Geo-Targeted",geoDesc:"Location-based ad serving.",feat1:"High-Resolution Display",feat1Desc:"Crisp, bright, and vibrant images and videos, ensuring that your message is seen clearly, day or night.",feat2:"Weatherproof & Durable",feat2Desc:"Designed to withstand the elements, our LED screens are built for all weather conditions, ensuring long-lasting performance.",feat3:"Real-Time Content Updates",feat3Desc:"With the ability to update content remotely, advertisers can tailor their messages to different locations, times of day, or current events.",feat4:"Mobile Flexibility",feat4Desc:"Mounted on vehicles, the LED screens offer unparalleled mobility, allowing your brand to be seen in high-traffic areas, events, or neighborhoods.",exploreBtn:"Explore Tech",tagDynamic:"Dynamic",tagFixed:"Fixed",tagTargeted:"Targeted"},contact:{title:"Get In Touch",desc:"We're here to help bring your vision to life! Whether you're ready to start your next advertising campaign, have questions about our services, or just want to learn more, we'd love to hear from you.",contactTitle:"Contact Us",name:"Name",email:"Email",phone:"Phone",message:"Message",submit:"Submit",faqTitle:"Getting Started FAQ",faqs:[{q:"How do I get started with Nawafith Advertising?",a:"Getting started with Nawafith Advertising is easy! Simply reach out to our team through our contact page or by phone, and well schedule an initial consultation. During this consultation, well discuss your advertising goals, select the best vehicle format (e.g., wraps or LED screens), and tailor a solution that fits your needs."},{q:"What types of vehicles can be used for advertising?",a:"We can transform a wide range of vehicles into mobile advertising platforms, including cars, vans, trucks, buses, and even fleet vehicles. Whether you have one vehicle or an entire fleet, we can provide customized advertising solutions."},{q:"How long does it take to get my vehicle(s) ready for advertising?",a:"The timeline for preparing your vehicle depends on the type of advertising solution. For vehicle wraps, it typically takes 5-7 days for installation. For LED screen advertising, setup and installation can take up to 2 weeks depending on the complexity and vehicle size."},{q:"Can I choose the design of the advertisement?",a:"Absolutely! Our creative team works closely with you to design an advertisement that reflects your brands identity and goals. We ensure that every design is eye-catching, professional, and tailored to your vision."},{q:"Do you offer geo-targeted advertising?",a:"Yes, we offer geo-targeting through our LED screen advertising format. This means we can deliver specific messages to certain locations, times of day, or demographics, ensuring your advertising is highly relevant to the audience in each area."}],knowledgeBaseLabel:"Knowledge Base",phoneValue:"+123-456-7890",addressValue:"Khobar, Saudi Arabia",emailValue:"Nawafithadvsa@gmail.com"},footer:{desc:"At Nawafith, we are proud to be a leading advertising company operating in Saudi Arabia, aligning our services with the ambitious goals of Vision 2030. Our mission is to support businesses in unlocking their potential through innovative, data-driven advertising solutions tailored to the evolving Saudi market.",signupTitle:"Reach Out to Us!",signupDesc:"Sign up with your email address to receive news and updates.",email:"Email",send:"Send",contactUs:"Contact us",copyright:" 2025 Nawafith City Advertising. All Rights Reserved",about:"About Us",formats:"Advertising Formats",contact:"Contact Us",legal:"Legal Disclaimers",navigation:"Navigation",reachUs:"Reach Us",address:"Saudi Arabia, Al Khobar.",privacyPolicy:"Privacy Policy",termsOfService:"Terms of Service"},leverage:{title:"How to Leverage",titlePart2:"Nawafith Ads",desc:"Nawafith Advertising offers innovative On-Car advertising solutions, turning vehicles into mobile billboards with dynamic digital screens. Custom-designed for maximum visibility, our screens display vibrant ads in real-time, ensuring your message reaches the right audience.",desc2:"Nawafith Advertising offers a unique blend of creativity, strategy, and innovation to help clients achieve their marketing goals effectively. By leveraging our services, businesses can unlock opportunities to connect with their target audience and create lasting impressions. Heres how you can benefit from our tailored advertising solutions",realtime:"Real-time engagement",realtimeDesc:"Our screens provide vibrant ads in real-time, ensuring your message reaches the right audience at the right time.",strategic:"Strategic placement",strategicDesc:"We position your brand in high-traffic areas, events, or specific neighborhoods to maximize exposure.",download:"Download",presentation:"COMPANY PRESENTATION",strategyLabel:"Strategy",networkLive:"Network Live"},footerImage:{urbanNetwork:"Urban Network"},offerings:{title:"Our Offerings",desc:"Nawafith Advertising offers a range of innovative on-car advertising services designed to help brands reach their target audience effectively. Our services include:",card1Title:"Digital Vehicle Advertising",card1Desc:"Utilizing digital screens mounted on vehicles, we provide dynamic and customizable advertising content. This service allows for real-time updates, targeted messaging, and enhanced engagement with on-the-go consumers.",getInTouch:"GET IN TOUCH"}},bb={nav:{home:"",about:" ",formats:" ",contact:" ",callNow:" "},hero:{welcomeTo:"  ",title:`
